public void testMultiValues() {
  NamedList nl = new NamedList();
  nl.add("x", "X1");
  nl.add("x", "X2");
  nl.add("x", new String[]{"X3", "X4"});
  Map<String, String[]> m = SolrParams.toMultiMap(nl);
  String[] r = m.get("x");
  assertTrue(Arrays.asList(r).containsAll(Arrays.asList(new String[]{"X1", "X2", "X3", "X4"})));
}

